import React from 'react';
import { Card, Button } from 'react-bootstrap';

function Skills(props) {
    return (
        <Card>
        <Card.Header as="h5">Featured</Card.Header>
        <Card.Body>
            <Card.Title>Special title treatment</Card.Title>
            <Card.Text>
            <img
                src={require("../../assets/icons/cssGood.png")}
                alt="css"
            />
            <img
                src={require("../../assets/icons/htmlGood.png")}
                alt="css"
            />
            <img
                src={require("../../assets/icons/jsGood.png")}
                alt="css"
            />
            <img
                src={require("../../assets/icons/MySQLGood.png")}
                alt="css"
            />
            <img
                src={require("../../assets/icons/pngegg.png")}
                alt="css"
            />
            <img
                src={require("../../assets/icons/ReactGood.png")}
                alt="css"
            />
            </Card.Text>
            <Button variant="primary">Go somewhere</Button>
        </Card.Body>
        </Card>
    );
}

export default Skills;
